import React, { useState } from "react";
import { TextField } from "@mui/material";

function CombatantFormInput() {
  const [combatants, setAllcombatants] = useState([
    { name: "a", hp: "15", init: 15, bonus: 15, type: "player" },
    { name: "b", hp: "1", init: 1, bonus: 1, type: "enemy" },
    { name: "b", hp: "1", init: 1, bonus: 1, type: "enemy" },
  ]);
  const test = (e) => {
    e.preventDefault();
  };

  return (
    <form onSubmit={test}>
      {combatants.map((combatant, index) => (
        <div key={index}>
          {Object.values(combatant).map((value, index) => {
            return (
              <div key={index}>
                <h2>{value}</h2>
              </div>
            );
          })}
        </div>
      ))}
      <div>
        <input type="text" id="name"></input>
        <input type="text" id="hp"></input>
        <input type="Submit"></input>
      </div>
    </form>
  );
}
export default CombatantFormInput;
